ThenActions.Text:
(() => {
    "use strict";

    // Clipboard populated with:
    // 1. Rich text in the form of any HTML in the
    //    Keyboard Maestro variable named "htmlFromMD".
    // 2. Plain text without the MD markup

    ObjC.import("AppKit");

    // main :: IO ()
    const main = () => {
        const
            html = Application(
                "keyboard Maestro Engine"
            ).getvariable("htmlFromMD"),
            unmarked = plainTextFromHTML(html);

        return (
            copyTypedString(true)(
                "public.utf8-plain-text"
            )(
                unmarked
            ),
            copyTypedString(false)(
                "public.html"
            )(html),
            unmarked
        );
    };


    // ----------------------- JXA -----------------------

    // copyTypedString :: Bool -> String -> String -> IO ()
    const copyTypedString = blnClear =>
        // public.html, public.rtf, public.utf8-plain-text
        pbType => s => {
            const pb = $.NSPasteboard.generalPasteboard;

            return (
                blnClear && pb.clearContents,
                pb.setStringForType(
                    $(s),
                    $(pbType)
                )
            );
        };

    // plainTextFromHTML :: String -> String
    const plainTextFromHTML = s =>
        // Assumes properly encoded HTML
        // see plainTextFromRoughHTML for something
        // slightly more robust.
        ObjC.unwrap(
            $.NSAttributedString.alloc
            .initWithHTMLDocumentAttributes(
                $(s)
                .dataUsingEncoding($.NSUTF8StringEncoding),
                0
            ).string
        );

    return main();
})();
